message:
Parece que a Direita deixará de existir no Brasil. 
Qualquer um que se opor ao regime de repressão e ódio, será perseguido e execrado. 

‼️Advogados entram com liminar para suspender posse de aliados de Bolsonaro.

O grupo Prerrogativas —um coletivo formado por diversos advogados brasileiros— além de ser composto por artistas, professores e juristas, protocolou um pedido de liminar junto ao Supremo Tribunal Federal (STF) para suspender a diplomação de parlamentares aliados ao ex-presidente Jair Bolsonaro (PL). São eles:

Carlos Jordy (PL-RJ);
Silvia Wãiapi (PL-AP);
André Fernandes (PL-CE);
Nikolas Ferreira (PL-MG);
Sargento Rodrigues (PL-MG);
Walber Virgolino (PL-PB).

Os advogados alegam que os parlamentares diplomados apoiaram os atos do último domingo, 8, em Brasília, quando manifestantes ocuparam e depredaram a Praça dos Três Poderes.

Imagens de publicações feitas pelos deputados em suas contas pessoais na redes sociais foram anexadas ao pedido
